import React, { Component } from "react";
import StarStyles from "../Styles/Stars.css";
import Container from "../Styles/Container.css";
import $ from "jquery";
import Options from "./Options";
import About from "./About";
import Experience from "./Experience";
import { Navbar, Nav, NavItem, NavDropdown, MenuItem } from "react-bootstrap";

let visVar = "visible";

export default class HomePage extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      width: 0,
      height: 0,
      aboutHeight: 0,
      visibility: "visible",
      scrollPosY: 0
    };
    this.updateWindowDimensions = this.updateWindowDimensions.bind(this);
  }

  componentDidMount() {
    this.updateWindowDimensions();
    this.scrollPosition();
    window.addEventListener("resize", this.updateWindowDimensions);
    window.addEventListener("scroll", this.scrollPosition);
  }

  componentWillUnmount() {
    window.removeEventListener("resize", this.updateWindowDimensions);
    window.removeEventListener("scroll", this.scrollPosition);
  }

  updateWindowDimensions() {
    this.setState({ width: window.innerWidth, height: window.innerHeight });
  }

  handleClickAbout = () => {
    window.scrollTo({ top: this.state.height * 1.13, behavior: "smooth" });
  };

  scrollPosition = () => {
    this.setState({ scrollPosY: window.scrollY });
  };

  getSize = container => {
    document.getElementById(container);
  };

  render() {
    return (
      <div
        id="background"
        className="no-cpu"
        // style={{ backgroundColor: "black", height: "5000px" }}
      >
        <div className="stars" />
        <div className="twinkling">
          <Options
            width={this.state.width}
            height={this.state.height}
            aboutHeight={this.state.aboutHeight}
            handleClickAbout={this.handleClickAbout}
          />

          <Navbar
            style={{
              width: this.state.width,
              height: this.state.height / 12,
              backgroundColor: "black",
              borderStyle: "solid",
              borderWidth: 0.5,
              borderBottom: "solid 2px white",
              marginTop: this.state.height / 4,
              zIndex: 10,
              position: "sticky",
              top: 0,
              visibility: visVar,
              paddingRight: 10
            }}
            data-aos="fade"
            data-aos-easing="ease-in"
            data-aos-duration="100"
            data-aos-anchor-placement="top-center"
          >
            <div
              id="navbar"
              style={{
                display: "flex",
                flexDirection: "row",
                justifyContent: "center",
                alignContent: "center",
                width: this.state.width / 6,
                paddingTop: "1%",
                position: "sticky"
              }}
              className="smallerText"
            >
              <div
                className="navbarContainer"
                style={{
                  borderStyle:
                    this.state.scrollPosY > this.state.height / 1.4 &&
                    this.state.scrollPosY < this.state.height * 1.75
                      ? "solid"
                      : "hidden",
                  cursor: "pointer"
                }}
                onClick={() => this.handleClickAbout()}
              >
                <p>About</p>
              </div>
              <div>
                <p style={{ paddingRight: 30 }}>Experience</p>
              </div>
              <div>
                <p style={{ paddingRight: 30 }}>Skills</p>
              </div>
              <div>
                <p>Projects</p>
              </div>
            </div>
          </Navbar>

          <div style={{ marginTop: this.state.height / 8 }} id="about">
            <About width={this.state.width} height={this.state.height} />
          </div>
          <div style={{ marginTop: this.state.height / 3 }}>
            <center>
              <div
                style={{
                  position: "sticky",
                  //position: "-webkit-sticky",
                  top: "100px"
                }}
                className="text"
                data-aos="fade-down"
                data-aos-easing="ease-in"
                data-aos-duration="500"
                data-aos-anchor-placement="top-center"
                data-aos-offset="-100"
              >
                My Job Experiences
              </div>
            </center>
            <Experience width={this.state.width} height={this.state.height} />
          </div>
        </div>
      </div>
    );
  }
}
